import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  useRouteMatch,
  useParams
} from "react-router-dom";
import Navbar from './Components/Navbar';
import Counter from './Components/Counter';
import FormDetails from './Components/c-form/FormDetails';
import CheckoutFrom from './Components/CheckoutFrom';
import PoForm from './Components/Posh-Form/PoForm';
import FormModal from './Components/FormModal';




function App() {
  return (
    <Router>
      <Switch>
        <Navbar />
        <Route path='/' component={CheckoutFrom} />
        <Route path='/counter' component={Counter} />
        <Route path='/formDetails' component={FormDetails} />
        <Route path='/formModal' component={FormModal} />
        <Route path='/poForm' component={PoForm} />
        {/* <CheckoutFrom /> */}
        {/* <Counter /> */}
        {/* <FormDetails /> */}
        {/* < FormModal /> */}
      <PoForm />
      </Switch>
    </Router>
  );
}

export default App;
